import styled from 'styled-components'

import Text from './Text'

const Root = styled.div`
  display: flex;
`

const Web = styled.div`
  margin-right: 40vw;
  * { color: #aaa }
`

const Mony = styled.span`
  font-style: italic;
  margin-left: 10px;
  margin-bottom: 10px;
`

const Other = styled.div`

`

export default function Skills (props) {
  return (
    <Root>
      <div>
      <Text type='h2'>Web Development</Text>
      <Web>
        <Text type='h3'>HTML<Mony> | Ben is pretty good at doing this - Austin</Mony></Text>
        <Text type='h3'>CSS</Text>
        <Text type='h3'>JS</Text>
        <Text type='h3'>React</Text>
        <Text type='h3'>p5</Text>
      </Web>
      </div>

      <div>
      <Text type='h2'>Fa'slhfshfsd</Text>
      <Other>
        <Text type='h3'>Java</Text>
        <Text type='h3'>Kotlin</Text>
      </Other>
      </div>
    </Root>
  )
}

